import React from "react";
import './Sobre.css'

function Sobre(){
    return(
        <section className="sobre">
            <h1>Sobre</h1>
            <img src="/imagens/a.png" id="foto"/>
            <p><h3>Programação é o processo de escrita, teste e manutenção de um programa de computador. 
                O programa é escrito em uma linguagem de programação, embora seja possível, com alguma dificuldade, o escrever diretamente em linguagem de máquina. 
                Diferentes partes de um programa podem ser escritas em diferentes linguagens. </h3></p>
        </section>
        )
}

export default Sobre
